exports.sendTestEmail = functions.https.onRequest(async (req, res) => {
  try {
    // Set the API key for this request
    apiKey.apiKey = functions.config().brevo.key;
    
    const apiInstance = new SibApiV3Sdk.TransactionalEmailsApi();
    const sendSmtpEmail = {
      to: [{ email: req.body.to || 'your@email.com', name: req.body.name || 'Recipient' }],
      sender: { email: 'your@email.com', name: 'Your Name' },
      subject: req.body.subject || 'Test Email from Firebase + Brevo',
      htmlContent: req.body.html || '<h1>Hello from Firebase Functions + Brevo!</h1>'
    };
    await apiInstance.sendTransacEmail(sendSmtpEmail);
    res.status(200).send('Email sent successfully!');
  } catch (error) {
    console.error('Error sending email:', error);
    res.status(500).send('Failed to send email.');
  }
});

