// Function to get email templates from Firestore
exports.getEmailTemplates = functions.https.onRequest(async (req, res) => {
  res.set('Access-Control-Allow-Origin', '*');
  
  try {
    const doc = await db.collection('settings').doc('emailTemplates').get();
    if (doc.exists) {
      res.status(200).json(doc.data());
    } else {
      res.status(404).json({ error: 'Templates not found' });
    }
  } catch (error) {
    console.error('Error getting email templates:', error);
    res.status(500).json({ error: 'Failed to get templates' });
  }
});

