// PPP (Perfect Property Profile) function
exports.updateContactPPP = functions.https.onRequest(async (req, res) => {
  // Enable CORS
  res.set('Access-Control-Allow-Origin', '*');
  res.set('Access-Control-Allow-Methods', 'GET, POST, OPTIONS');
  res.set('Access-Control-Allow-Headers', 'Content-Type, Authorization');

  if (req.method === 'OPTIONS') {
    res.status(204).send('');
    return;
  }

  if (req.method !== 'POST') {
    res.status(405).json({ error: 'Method not allowed' });
    return;
  }

  try {
    const { contactId, email, phone, pppData } = req.body;

    if (!pppData) {
      res.status(400).json({ error: 'PPP data is required' });
      return;
    }

    let contactDoc = null;
    let contactIdToUse = contactId;

    // If no contactId provided, try to find by email or phone
    if (!contactIdToUse) {
      if (email) {
        const emailQuery = await db.collection('contacts').where('email', '==', email).get();
        if (!emailQuery.empty) {
          contactDoc = emailQuery.docs[0];
          contactIdToUse = contactDoc.id;
        }
      }
      
      if (!contactDoc && phone) {
        // Format phone number for search
        const formattedPhone = phone.replace(/\D/g, '');
        const phoneQuery = await db.collection('contacts').where('cellPhone', '==', formattedPhone).get();
        if (!phoneQuery.empty) {
          contactDoc = phoneQuery.docs[0];
          contactIdToUse = contactDoc.id;
        }
      }
    } else {
      // Get contact by provided ID
      contactDoc = await db.collection('contacts').doc(contactIdToUse).get();
    }

    if (!contactDoc || !contactDoc.exists) {
      res.status(404).json({ error: 'Contact not found' });
      return;
    }

    // Get contact data to check if template #9 was previously sent
    const contactData = contactDoc.data();
    const wasPromptedForPPP = contactData.pppPromptEmailSent || 
                               contactData.lastEmailTemplateId === 9 ||
                               contactData.template9Sent === true;

    // Update contact with PPP data
    const updateData = {
      pppProfile: pppData,
      pppCompleted: true,
      pppCompletedAt: admin.firestore.FieldValue.serverTimestamp(),
      lastUpdated: admin.firestore.FieldValue.serverTimestamp()
    };

    await db.collection('contacts').doc(contactIdToUse).update(updateData);

    console.log('PPP profile updated for contact:', contactIdToUse);

    // If contact was previously prompted with template #9, send follow-up template #26
    if (wasPromptedForPPP && contactData.email) {
      try {
        console.log('Contact was prompted with template #9, sending follow-up template #26');
        
        const brevoApiKey = functions.config().brevo.key;
        if (brevoApiKey) {
          apiKey.apiKey = brevoApiKey;
          
          const transactionalApi = new SibApiV3Sdk.TransactionalEmailsApi();
          const nameParts = (contactData.name || '').split(' ');
          const firstName = nameParts[0] || '';
          const lastName = nameParts.slice(1).join(' ') || '';
          
          const sendSmtpEmail = new SibApiV3Sdk.SendSmtpEmail();
          sendSmtpEmail.to = [{ email: contactData.email, name: contactData.name || '' }];
          sendSmtpEmail.templateId = 26;
          sendSmtpEmail.params = {
            FIRSTNAME: firstName,
            LASTNAME: lastName,
            NAME: contactData.name || ''
          };
          sendSmtpEmail.subject = 'Thank you for completing your Property Profile - Real InvestCo';
          
          await transactionalApi.sendTransacEmail(sendSmtpEmail);
          
          console.log('Follow-up template #26 sent successfully to:', contactData.email);
          
          // Track that template #26 was sent
          await db.collection('contacts').doc(contactIdToUse).update({
            pppFollowUpEmailSent: true,
            pppFollowUpEmailSentAt: admin.firestore.FieldValue.serverTimestamp(),
            lastEmailTemplateId: 26
          });
        }
      } catch (emailError) {
        console.error('Error sending follow-up template #26:', emailError);
        // Don't fail the PPP update if email fails
      }
    }

    res.status(200).json({
      success: true,
      message: 'Perfect Property Profile updated successfully',
      contactId: contactIdToUse,
      followUpEmailSent: wasPromptedForPPP || false
    });

  } catch (error) {
    console.error('Error updating PPP profile:', error);
    res.status(500).json({ 
      error: 'Failed to update PPP profile',
      details: error.message 
    });
  }
});

